1fa4022c4e9f33fe32bf6dc4a31977de56dd8e00.source:
mutation userLogin($userName: String!, $password: String!) {
  userLogin(userName: $userName, password: $password) {
    __typename
    ok
    error
    token {
      __typename
      accessToken
      refreshToken
    }
  }
}
